import './ExpensesFilter.css';

const ExpensesFilter = (props) => {

    const getYearHandler = () => {
        console.log("Holaa");
    }

    return (
        <div className='expenses-filter'>
            <div className='expenses-filter__control'>
                <label>Filter by year</label>
                <select>
                    <option onChange={getYearHandler} value='2022'>2022</option>
                    <option onChange={getYearHandler} value='2021'>2021</option>
                    <option onChange={getYearHandler} value='2020'>2020</option>
                    <option onChange={getYearHandler} value='2019'>2019</option>
                </select>
            </div>
        </div>
    );
};

export default ExpensesFilter;
